def check(d):
    stack = []
    for c in d:
        if c in '[({':
            stack.append(c)
        if not stack and c in '])}':
            return 0
        elif c in '])}':
            if c ==']' and stack[-1] == '[':
                stack.pop()
                continue
            if c =='}' and stack[-1] == '{':
                stack.pop()
                continue
            if c ==')' and stack[-1] == '(':
                stack.pop()
                continue
    if stack:
        return 0
    else:
        return 1

